    const dateValue = new Date('05/11/2021')
    const [date, setDate] = useState(new Date().today())


    return (
        <>
            <CalendarComponent 
            value ={date}
            // value={dateValue}
            onChange={e => setDate(e.target.value)}
            ></CalendarComponent>
        </>
    )
}

export default Calander
